      "| Adam | epoch: 010 | loss: 0.28708 - acc: 0.8866 -- iter: 24448/24500\n",
      "Training Step: 3830  | total loss: 0.28767 | time: 74.276s\n",
      "| Adam | epoch: 010 | loss: 0.28767 - acc: 0.8854 | val_loss: 0.60003 - val_acc: 0.7840 -- iter: 24500/24500\n",
